import React,{Component} from 'react';
import "semantic-ui-css/semantic.min.css";
import{
  Grid,
  Form,
  Button,
}from "semantic-ui-react";

class App extends Component {
  render(){
    return (
      <div>
        <br/><br/><br/><br/><br/>
        <Segment>
          <Grid columns={2} stackable textAlign="center">
            <Divider vertical>Or</Divider>
          </Grid>
        </Segment>
      </div>
    );
  }
}

export default App;
